import * as React from 'react';
import { Button } from 'react-native-web';
import { Header,Container,Title,HeaderButtonLeft,HeaderButtonRight,Container2} from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';

function AddAlarmScreen({ navigation }) { 
    return(
        <Container>
            <Header>
                <HeaderButtonLeft>
                    <Ionicons name="chevron-back" size={20} color={"black"} />
                </HeaderButtonLeft>
                <HeaderButtonRight>
                    <Entypo name="dots-two-horizontal" size={20} color="black" />
                </HeaderButtonRight>
                <Title>Add Alarm</Title>
            </Header>
            <Container>
                <Button 
                title="Add" 
                onPress={() => navigation.navigate()}
                />
                <Button
                title="Go to"
                onPress={() => navigation.navigate('AddAlarm')}
                />
            </Container>
            <Container2>
                <TextContainer2>Bedtime</TextContainer2>
            </Container2>
        </Container>
    );
}

export default AddAlarmScreen;
